import React from 'react';

const AddPhoto = () => {
    return(
        <div>
            <h1>Photowall</h1>
            <div>
                <form>
                    <input type = "text" placeholder = "Link"></input>
                    <input type = "text" placeholder = "Description"></input>
                </form>
            </div>
        </div>
    )
}

export default AddPhoto;
